;'use strict';

var App = angular.module('app', [
  // angular modules...
  'ngRoute'
]);
;'use strict';

App.controller('feedController', function($scope, $http) {

  $scope.feed = [];

  var appendImagesToFeed = function(images) {
    $scope.feed = $scope.feed.concat(images);
    console.log('$scope.feed', $scope.feed);
  };

  var getImages = function(page) {
    $http.get('/feed', {params: {page: page}})
    .success(function(data, status, headers, config) {
      // console.log('SUCCESS', data, status, headers, config);
      console.log('DATA', data);
      appendImagesToFeed(data);
    })
    .error(function(data, status, headers, config) {
      console.log('ERROR', data, status);
      $scope.errors = data;
    });
  };

  $scope.init = function() {
    getImages(1);
  };

  $scope.nexPage = function() {

  };

});

;'use strict';

App.controller('greetingCtrl', function($scope) {
  this.greeting = 'Hello World';
  this.title = 'Image Feed';
});
;'use strict';

App.controller('imageController', function($scope, $http, $location, $anchorScroll) {

  console.log($location.path());

  $http.get($location.path())
  .success(function(data, status, headers, config) {
    // console.log('SUCCESS', data, status, headers, config);
    console.log('DATA', data);
    $scope.image = data;
    $anchorScroll();
  })
  .error(function(data, status, headers, config) {
    console.log('ERROR', data, status);
    $scope.errors = data;
  });

});

;'use strict';

angular.module('app.filters.encodeURIComponent', [])
.filter(function() {
  return window.encodeURIComponent;
});
;'use strict';

// CLIENT ROUTES

App.config([
  '$routeProvider',
  function($routeProvider) {
    $routeProvider
    .when('/', {
      templateUrl: '/views/feed.html',
      controller: 'feedController'
    })
    .when('/image/:provider/:id', {
      templateUrl: '/views/image.html',
      controller: 'imageController'
    })
    .otherwise({
      redirectTo: '/'
    });
  }
]);
